import React, { useState, useEffect } from 'react';

const SimpleApiTest = () => {
  const [status, setStatus] = useState('idle');
  const [result, setResult] = useState(null);
  const [error, setError] = useState(null);

  const testDirectFetch = async () => {
    setStatus('testing-direct');
    setError(null);
    setResult(null);

    try {
      console.log('Testing direct fetch to API...');
      const response = await fetch('/api/dogs', {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json',
        },
      });

      console.log('Response status:', response.status);
      console.log('Response headers:', Object.fromEntries(response.headers.entries()));

      if (!response.ok) {
        throw new Error(`HTTP ${response.status}: ${response.statusText}`);
      }

      const data = await response.json();
      console.log('Response data:', data);

      setResult(data);
      setStatus('success');
    } catch (err) {
      console.error('Direct fetch error:', err);
      setError(err.message);
      setStatus('error');
    }
  };

  const testAxios = async () => {
    setStatus('testing-axios');
    setError(null);
    setResult(null);

    try {
      console.log('Testing axios request...');
      const response = await fetch('/api/dogs');
      const data = await response.json();

      setResult(data);
      setStatus('success');
    } catch (err) {
      console.error('Axios error:', err);
      setError(err.message);
      setStatus('error');
    }
  };

  const testCORS = async () => {
    setStatus('testing-cors');
    setError(null);
    setResult(null);

    try {
      console.log('Testing CORS with direct API...');
      const response = await fetch('https://bj9jbp1rgf.execute-api.us-east-1.amazonaws.com/prod/dogs', {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json',
        },
      });

      if (!response.ok) {
        throw new Error(`HTTP ${response.status}: ${response.statusText}`);
      }

      const data = await response.json();
      setResult(data);
      setStatus('success');
    } catch (err) {
      console.error('CORS test error:', err);
      setError(err.message);
      setStatus('error');
    }
  };

  // Auto-test on component mount
  useEffect(() => {
    testDirectFetch();
  }, []);

  return (
    <div className="p-6 bg-white rounded-lg shadow-sm border border-gray-200 mb-6">
      <h3 className="text-lg font-semibold mb-4">🔧 Simple API Test (No React Query)</h3>

      <div className="flex flex-wrap gap-2 mb-4">
        <button
          onClick={testDirectFetch}
          disabled={status.includes('testing')}
          className="px-4 py-2 bg-blue-500 text-white rounded hover:bg-blue-600 disabled:bg-gray-400"
        >
          Test Proxy (/api/dogs)
        </button>

        <button
          onClick={testAxios}
          disabled={status.includes('testing')}
          className="px-4 py-2 bg-green-500 text-white rounded hover:bg-green-600 disabled:bg-gray-400"
        >
          Test Fetch
        </button>

        <button
          onClick={testCORS}
          disabled={status.includes('testing')}
          className="px-4 py-2 bg-orange-500 text-white rounded hover:bg-orange-600 disabled:bg-gray-400"
        >
          Test Direct CORS
        </button>
      </div>

      <div className="mb-4">
        <strong>Status:</strong> <span className={`px-2 py-1 rounded text-sm ${
          status === 'success' ? 'bg-green-100 text-green-800' :
          status === 'error' ? 'bg-red-100 text-red-800' :
          status.includes('testing') ? 'bg-blue-100 text-blue-800' :
          'bg-gray-100 text-gray-800'
        }`}>
          {status}
        </span>
      </div>

      {error && (
        <div className="bg-red-50 border border-red-200 rounded-lg p-4 mb-4">
          <h4 className="text-red-800 font-semibold mb-2">Error:</h4>
          <p className="text-red-700 text-sm">{error}</p>
        </div>
      )}

      {result && (
        <div className="bg-green-50 border border-green-200 rounded-lg p-4">
          <h4 className="text-green-800 font-semibold mb-2">Success!</h4>
          <p className="text-green-700 mb-2">
            Found {result.data?.count || 0} dogs
          </p>
          <pre className="text-xs text-green-600 overflow-auto max-h-40">
            {JSON.stringify(result, null, 2)}
          </pre>
        </div>
      )}

      <div className="mt-4 p-3 bg-blue-50 border border-blue-200 rounded text-sm">
        <strong>Debug Info:</strong><br/>
        Environment: {process.env.NODE_ENV}<br/>
        Current URL: {window.location.origin}<br/>
        Proxy URL: {window.location.origin}/api/dogs<br/>
        Direct API: https://bj9jbp1rgf.execute-api.us-east-1.amazonaws.com/prod/dogs
      </div>
    </div>
  );
};

export default SimpleApiTest;
